import React, { Component } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import withNavigation from "./WithNavigation";
import withParams from "./WithParams";
import HeaderComponent from "./HeaderComponent";
import FooterComponent from "./FooterComponent";
import LoginComponent from "./LoginComponent";
import WelcomeComponent from "./WelcomeComponent";
import ErrorComponent from "./ErrorComponent";
import ListProgressComponent from "./ListProgressComponent";
import LogoutComponent from "./LogoutComponent";
import AuthenticatedRoute from "./AuthenticatedRoute";

class GymProgressApp extends Component {
    render() {
        const LoginComponentWithNavigation = withNavigation(LoginComponent);
        const HeaderComponentWithNavigation = withNavigation(HeaderComponent);
        const WelcomeComponentWithParams = withParams(WelcomeComponent);

        return (
            <div className="GymProgressApp">
                <BrowserRouter>
                    <HeaderComponentWithNavigation />
                    <Routes>
                        <Route
                            path="/"
                            element={<LoginComponentWithNavigation />}
                        />
                        <Route
                            path="/login"
                            element={<LoginComponentWithNavigation />}
                        />
                        <Route
                            path="/welcome/:name"
                            element={<WelcomeComponentWithParams />}
                        />
                        <Route
                            path="/progress"
                            element={<ListProgressComponent />}
                        />
                        <Route path="/logout" element={<LogoutComponent />} />
                        <Route path="*" element={<ErrorComponent />} />
                    </Routes>
                    <FooterComponent />
                </BrowserRouter>
            </div>
        );
    }
}

export default GymProgressApp;
